using Amazon.CDK.AWS.Route53;

HostedZone zone;


AwsCustomResource verifyDomainIdentity = new AwsCustomResource(this, "VerifyDomainIdentity", new AwsCustomResourceProps {
    OnCreate = new AwsSdkCall {
        Service = "SES",
        Action = "verifyDomainIdentity",
        Parameters = new Dictionary<string, string> {
            { "Domain", "example.com" }
        },
        PhysicalResourceId = PhysicalResourceId.FromResponse("VerificationToken")
    },
    Policy = AwsCustomResourcePolicy.FromSdkCalls(new SdkCallsPolicyOptions {
        Resources = AwsCustomResourcePolicy.ANY_RESOURCE
    })
});
new TxtRecord(this, "SESVerificationRecord", new TxtRecordProps {
    Zone = zone,
    RecordName = "_amazonses.example.com",
    Values = new [] { verifyDomainIdentity.GetResponseField("VerificationToken") }
});

